import './card.css'

function Card({title, index, titleButton, textList}){
    return(

        <div>

            <div className='container'>
                <div>{index}</div>
                <h2 >{title}</h2>
            </div>

            <div>
                {textList.map(text => <p>{text}</p>)}
            </div>

            <button>{titleButton}</button>

        </div>
    );
}

export default Card;
